import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';

export default function Donation() {

    return(
        <Paper elevation={0} style={{ textAlign: 'center', margin: '20px'}}>
            <Typography variant="h6" component="h2" style={{ marginBottom: '', borderBottom: "2px solid rgb(212, 212, 212)"}}>
                Diana Panich donated 56$ to ValueCulture
            </Typography>
        </Paper>
    )

}
